import { Divider } from 'antd';
import './customDivider.css';

function CustomDivider() {
	return (
		<div>
            <div className="custom-divider">1</div>
			<Divider style={{margin: '0px'}} />
            <div className="custom-divider">1</div>
		</div>
	);
}

export default CustomDivider;
